import React from 'react'

export default function test() {
  return (
    <div>
      
        {countries.map(({ Country, ISO2 }) => (
            <option key={ISO2} value={ISO2.toLowerCase()}>
              {Country}
            </option>
          ))}
      
    </div>
  )
}
